// src/pages/SobrePage.js
import React from 'react';

const SobrePage = () => (
  <div className="about-page">
    <h1>Sobre a Brasfi</h1>
    <p>A Brasfi (Brazilian Financial Innovations) foi fundada em 2010 com o objetivo de digitalizar processos empresariais. Nossa missão é entregar soluções tecnológicas que aumentem a eficiência e a segurança das operações corporativas.</p>
    <p>Com expertise em Spring Boot, React, bancos de dados e metodologias ágeis, atendemos clientes de diversos setores.</p>
  </div>
);

export default SobrePage;
